import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
    </div>
  );
}

function Header() {
  return (
    <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <AppBody />
    </header>
  );
}

function AppBody() {
  return (
    <>
      <p>TJE</p>
      <a
        className="App-link"
        href="https://www.kvarnbergproducts.se"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </>
  );
}

export default App;
